import React from  'react';
import propTypes from 'prop-types';

const User=({id})=>{
    console.log(id);
    return(
        <div>user {id}</div>
    );
}; 

User.propTypes={
    id:propTypes.number.isRequired,
}

User.getInitialProps= async (context)=>{
    console.log('hashtag get Initial tag',context.query.id);
    return {tag : context.query.id};
};

export default User;
